import { DetailContainer, ImgDetails } from "./Guns.styles";

import {BP50} from "../../assets/images/BP50.jpg";

export function GunsDetails(){
    return(
        <DetailContainer>
                <div>
                    <h1>Infos</h1>
                </div>
                <ImgDetails src={BP50}></ImgDetails>
        </DetailContainer>
    )
}
